import React from 'react';

export class Charts extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
      1: [],
      2: [],
      3: [],
      4: []
    }
  }

  componentDidMount() {
    fetch("https://sheetdb.io/api/v1/hse3ttfafjgip")
      .then((response) => {
        return response.json()
      }).then((json) => {
        this.setState({data: json});
      });
  }

  renderData() {
    for (let i = 0; i < 4; i++) {
      var segments = this.state.data.filter(item => item.Week == i);
      (segments.length > 0) ? () => (
      <div>
        {segments.map((row) => <div key={row.Module}>
          <p>{row.Module}</p>
          <p>{row.Instructions}</p>
        </div>)}
      </div>) : '';
    }
  }

  // renderData() {
  //     this.state.data.map((row) => 
  //     <div key={row.Module}>
  //       <p>{row.Module}</p>
  //       <p>{row.Instructions}</p>
  //     </div>
  //     )

  // }

  render() {
    return(
      <div>
        {this.renderData()}
      </div>
    )
  }
}
